import React, { PureComponent } from 'react';
import ChartArea from "../Image/chartArea.png"
import Top1 from "./Top1.js";
import Top2 from "./Top2.js";
import Top3 from "./Top3.js";
import Top4 from "./Top4.js";

export default class HomeChartLeft extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
			 <div className="chart-right-whole">
                <div className="chart-area">
                    <div className="chart-title">文物统计</div>
                    <Top1></Top1>
                </div>
                <div className="chart-area">
                    <div className="chart-title">场馆环境实时数据</div>
                    <Top2></Top2>
                </div>
                <div className="chart-area">
                    <div className="chart-title">游客实时数据</div>
                    <Top3></Top3>
                </div>
				<div className="chart-area">
                    <div className="chart-title">场馆口碑</div>
                    <Top4></Top4>
                </div>
            </div>
        );
    }
}
